//import logo from './logo.svg';
import React, { Component } from "react";
import './App.css';

class Scheduler extends Component { 
  render() {
    let hourDenominations=['12am','1am','2am','3am','4am','5am','6am','7am','8am','9am','10am','11am','12pm','1pm','2pm','3pm','4pm','5pm','6pm','7pm','8pm','9pm','10pm','11pm',];
    return (
      <div>
        {hourDenominations.map(hourCount => (
          <HourBlock 
            hourCounter = {hourCount}
            spaceText = 'BAKE'
          />
        ))}
      </div>
    ); }
  }

class HourBlock extends Component { 
  render() {
    return (
      <div className="row-time">
        <div className='card p-3'>
          <div className='column-time'>
            {this.props.hourCounter}
          </div>
        </div>
        <div className='card p-3'>
          <div className='column-space'>
            {this.props.spaceText}
          </div>
        </div>
      </div>  
    ); }
  }

function App() {
  return (
    <div>
      <main className="container">
        <div className='header-box'>
          <h1 className="text-Black text-uppercase text-center my-4">BAKE BUDDY</h1>
        </div>
        <div className='row'>
          <div className='column'>
            <div className="col-md-6 col-sm-10 mx-auto p-0">
              <div className="card p-3">
                Some Text in Column One
              </div>
            </div>
          </div>
          <div className='column'>
            <div className='scroll-column'>
              <Scheduler />
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
